import React, { useState } from 'react';
import './gamesPage.css';

import Navbar from './navbar';
import Footer from './footer';

const GamesPage = ({onUrlChange = {}, onSearchClick = {}, searchValue = ""}) => {

    
    return (
        <>
        <Navbar onUrlChange={onUrlChange} onSearchClick={onSearchClick} searchValue={searchValue}/>
        {"filtering and sorting"}
        <main>
            {"games"}
        </main>
        <Footer />
        </>
    )
}

export default GamesPage;
